import React, { useState } from 'react';
import { UserContext } from '../App';
import { transactionAPI } from '../services/api';

const WithdrawModal = ({ isOpen, onClose, onWithdrawSuccess }) => {
  const { user, updateUser } = React.useContext(UserContext);

  const [amount, setAmount] = useState('');
  const [description, setDescription] = useState('');
  const [error, setError] = useState('');
  const [successMsg, setSuccessMsg] = useState('');
  const [loading, setLoading] = useState(false);

  if (!isOpen) return null;

  const handleAmountChange = (e) => {
    const value = e.target.value;
    // Only allow numbers and decimals
    if (/^\d*\.?\d*$/.test(value)) {
      setAmount(value);
      setError('');
    }
  };

  const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
  };

  const handleWithdraw = async (e) => {
    e.preventDefault();
    setError('');
    setSuccessMsg('');

    const withdrawAmount = parseFloat(amount);

    if (!amount || isNaN(withdrawAmount) || withdrawAmount <= 0) {
      setError('Please enter a valid withdrawal amount greater than zero.');
      return;
    }

    if (withdrawAmount > (user?.balance || 0)) {
      setError('Insufficient balance for this withdrawal.');
      return;
    }

    setLoading(true);
    try {
      const transaction = await transactionAPI.withdraw(user.id, withdrawAmount, description);
      setSuccessMsg('Withdrawal successful!');
      setAmount('');
      setDescription('');
      // Update user balance in context
      if (updateUser) {
        updateUser({ ...user, balance: transaction.balanceAfterTransaction });
      }
      if (onWithdrawSuccess) {
        onWithdrawSuccess(transaction);
      }
      // Optionally close modal after short delay
      setTimeout(() => {
        setSuccessMsg('');
        onClose();
      }, 1200);
    } catch (err) {
      setError(
        err?.error ||
        err?.message ||
        'Withdrawal failed. Please try again.'
      );
    } finally {
      setLoading(false);
    }
  };

  const handleClose = () => {
    setAmount('');
    setDescription('');
    setError('');
    setSuccessMsg('');
    onClose();
  };

  return (
    <div className="modal-overlay">
      <div className="modal">
        <button className="modal-close" onClick={handleClose} disabled={loading}>
          &times;
        </button>
        <h2 className="modal-title">Withdraw Money</h2>
        <form onSubmit={handleWithdraw}>
          <div className="form-group">
            <label htmlFor="withdraw-amount">Amount (USD)</label>
            <input
              id="withdraw-amount"
              type="text"
              inputMode="decimal"
              value={amount}
              onChange={handleAmountChange}
              placeholder="Enter amount"
              disabled={loading}
              autoFocus
            />
          </div>
          <div className="form-group">
            <label htmlFor="withdraw-description">Description (optional)</label>
            <input
              id="withdraw-description"
              type="text"
              value={description}
              onChange={handleDescriptionChange}
              placeholder="E.g. ATM withdrawal"
              disabled={loading}
            />
          </div>
          <div className="form-group">
            <div className="text-sm text-gray-600">
              Available balance: <strong>${(user?.balance || 0).toFixed(2)}</strong>
            </div>
          </div>
          {error && <div className="form-error">{error}</div>}
          {successMsg && <div className="form-success">{successMsg}</div>}
          <div className="form-actions">
            <button
              type="submit"
              className="btn btn-primary"
              disabled={loading}
            >
              {loading ? 'Processing...' : 'Withdraw'}
            </button>
            <button
              type="button"
              className="btn btn-secondary ml-2"
              onClick={handleClose}
              disabled={loading}
            >
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default WithdrawModal;
